import React from 'react';
import {Form,Button,Jumbotron} from 'react-bootstrap';
//import {Form,Jumbotron} from 'react-bootstrap';
function operators(){
    return(
        <div className = "operator">
        <form className = "operator-form">
        <Jumbotron>
    
        <Form.Group   controlId="formBasicOperator">
            <Form.Label>Operator Name</Form.Label>
            <Form.Control type="name" placeholder="Enter Operator Name" />
            <Form.Text className="text-muted">
            </Form.Text>
          </Form.Group>

          <Form.Group controlId="formBasicPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          
          
          <Form.Group controlId="formBasicConfirmPassword">
            <Form.Label>Comfirm</Form.Label>
            <Form.Control type="password" placeholder="Comfirm" />
          </Form.Group>

          <Button variant="secondary" type="save">
          submit
        </Button> 


        </Jumbotron>
        </form>
        </div>
    );
}

export default operators;
